INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1.4, 0, 1, "春咲 ひより", 0, "お！\nあそこに困ってそうな人発見！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 1.4, 0, 1, "草野 優衣", 0, "大切な人を\n守れるようになりたい…って", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "少しは磨かれると思いますよ。", 1003, 1, 0, "フェンシングを始めてみては？", 0, 1.4, 0, 1, "士条 怜", 0, "キミに必要な集中力と感性が", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 1, 0, "ねぇ、にいちゃん！", 0, 1.5, 0, 1, "穂高 みそぎ", 0, "今日はなにして遊ぶ？", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "私といっしょに…\nいかない？", 1006, 1, 0, "風宮あかりです", 0, 1.4, 0, 1, "風宮 あかり", 0, "ねぇ…", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "食べ物の恨みは怖いのー", 1007, 1, 0, "出雲宮子なのー", 0, 1.5, 0, 1, "出雲 宮子", 0, "プリンたべたいのー", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "いいよ。\n見られることは運命さ…", 1008, 1, 0, "ボクは虹村雪。", 0, 1.4, 0, 1, "虹村 雪", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "人呼んで「疾風の冥姫」!!", 1009, 1, 0, "フッ…聞いて後悔するがいい！", 0, 1.4, 0, 1, "柊杏奈", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ほんまおおきにやわ～♪", 1010, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1.5, 0, 1, "姫宮 真歩", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ここで会ったが\n100年目～！", 1011, 1, 0, "衣之咲璃乃です！", 0, 1.4, 0, 1, "衣之咲 璃乃", 0, "生き別れたお兄ちゃんを探して\n三千世界！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1012, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1.4, 0, 1, "柏崎 初音", 0, "ち、超能力って…\n何のことかな～？", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 1.4, 0, 1, "美波 鈴奈", 0, "一応カリスマ読モJKやってまっす！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "でも、沖縄もとってもいいとこさー", 1017, 1, 0, "はいたーい。\n喜屋武香織さー。", 0, 1.4, 0, 1, "喜屋武 香織", 0, "東京は遊園地みたいなところさー", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "イオちゃんって呼んでね。", 1018, 1, 0, "支倉伊緒です。", 0, 1.4, 0, 1, "支倉 伊緒", 0, "先生って呼ばれるのは\nくすぐったいから", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ミミをおいてかないでぇ～", 1020, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1.5, 0, 1, "茜 ミミ", 0, "あ！/\お兄ちゃ～ん\nまってよ～", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ふぇぇぇぇぇん……", 1021, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1.5, 0, 1, "栗林 くるみ", 0, "あの……\nふぇ……", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "なんてありがとうございます！", 1022, 1, 0, "風宮よりです。\nあああああ！", 0, 1.4, 0, 1, "風宮 より", 0, "こんな私に貴重な時間を\n割いていただき、", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "私こっち行きたいー\nね、早く早くー", 1023, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1.5, 0, 1, "北条 綾音", 0, "おにいちゃんどこいくの？\nえ？", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "これて何か違う…\nあああすみません！", 1025, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 1.4, 0, 1, "天野 すずめ", 0, "ふ、不束者ですが\nどうぞ末永く…って、", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "離しませんわ………\n絶対に…!!", 1027, 1, 0, "……クスクス…私は\n…倉石恵理子……", 0, 1.4, 0, 1, "倉石 恵理子", 0, "あなたは…運命の……\n伴侶……", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "…そうでしょ？？", 1028, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1.4, 0, 1, "佐々木 咲恋", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "あはは、\n私もまだまだだなぁ～", 1029, 1, 0, "桜井望だよ！\nよろしくねっ", 0, 1.4, 0, 1, "桜井 望", 0, "ぇっと…\nキミ、私のこと知らないの?!", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 1, 0, "デケデケデンっ！", 0, 1.4, 0, 1, "ニノン・ジュベール", 0, "初めまして、\n私はニノン・ジュベール申すデス！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "おかしいですね……", 1031, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 1.4, 0, 1, "上喜 しのぶ", 0, "でもって私の隣にいるのが……\nえ、見えない？", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "そう、\nオラのボケに突っ込める相方が…！", 1033, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1.5, 0, 1, "野戸まひる", 0, "けんども\nそれには足りないモンが…", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ちょ\nちょっと一杯飲んできます…！", 1034, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1.4, 0, 1, "綾瀬 ゆかり", 0, "ちょっと緊張しちゃって…", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "これ以上お話しすることは…\nないです！", 1036, 1, 0, "氷川鏡華…です", 0, 1.5, 0, 1, "氷川 鏡華", 0, "知らない人とは話しちゃいけないので", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 1, 0, "柏崎…栞です。", 0, 1.4, 0, 1, "柏崎 栞", 0, "……あ、アラーム。", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "野に咲く花が、\n唯一の話相手です。", 1040, 1, 0, "ふ、双葉碧です。", 0, 1.4, 0, 1, "双葉 碧", 0, "私、一人も友達がいなくて……", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "そう思っています。", 1042, 1, 0, "三角千歌です。", 0, 1.4, 0, 1, "三角 千歌", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "う、疑ってすまなかったな…", 1043, 1, 0, "安芸真琴だ。", 0, 1.4, 0, 1, "安芸 真琴", 0, "あぁ？\nお前のそいつの仲間か？", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 1, 0, "わらわこそは夜を総べる者！", 0, 1.4, 0, 1, "イリヤ・オーンスタイン", 0, "生けとし生ける全ての者よ！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "ｌク、クウカに何かご用ですか!?", 1045, 1, 0, "そこで騎士は妖精を乱暴に……", 0, 1.4, 0, 1, "遠見 空花", 0, "ぐふふふふ……はっ！", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1.4, 0, 1, "宮坂たまき", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 1, 0, "大神美冬よ！", 0, 1.4, 0, 1, "大神 美冬", 0, "それでは早速クエストに…", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 1, 0, "星野静流だよ！", 0, 1.4, 0, 1, "星野静流", 0, "クエストもバトルも\n掃除も洗濯も", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 1, 0, "アタシは玉泉美咲。", 0, 1.5, 0, 1, "玉泉美咲", 0, "見ての通りの\nセクシー美少女で", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "？？？？", 1052, 1, 0, "？？？", 0, 1.4, 0, 1, "リマ", 0, "？？？？", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1053, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 1.5, 0, 1, "モニカ・ヴァイスヴィント", 0, "菓子でつろうなどと\n稚拙な策を……", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1058, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 1.5, 0, 1, "ペコリーヌ", 0, "菓子でつろうなどと\n稚拙な策を……", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1059, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 1.5, 0, 1, "コッコロ", 0, "菓子でつろうなどと\n稚拙な策を……", 2);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1060, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 1.5, 0, 1, "キャル", 0, "菓子でつろうなどと\n稚拙な策を……", 2);
